A Little Week Recap!🥹 So as you all should know, this month is Breast Cancer Awareness Month🩷 as well as Domestic Violence Awareness Month💜, and Halloween also happens to fall at the end of this month as well LOL👻! 
@gsuwcc and @alphatheta1951 and a few other clubs and organizations came together for a Trunk Or Treat For The Kids *slide 4*🥹🥰!

&& @grambling1901 , @gsucampusliving held many events on campus in honor of those who’ve won and lost their battle to breast cancer or any cancer in that matter. We tried our best to attend all of them in respect to our survivor @beautyful_7 🥹🩷🩷! You Are Strong, You Are Loved And You And Everyone Else Who Has Fought Or Is Fighting That Battle Are Supported Always 🫶🏾✨
